window.bookSummaryJSON = "<p>A cop interrogates a perp in a lizard costume that seems all too real. </p> <p>An all-powerful superhero protects his city - and they better like it. </p> <p>An average Joe finds out that being undead isn't all that it's cracked up to be. </p> <p>Including three never-before-published stories, <i>Dead Men Can't Complain</i> is the first-ever collection of short fiction by Peter Clines, author of <i>14</i>, <i>The Fold</i>, and other Audible smash hits. Combining equal parts geekery and humor with the occasional dash of horror, <i>Dead Men Can't Complain</i> is ideal for Clines fans eagerly awaiting his next novel - or for brand-new listeners discovering this Audible favorite for the first time. </p>"; 
